     */
    function ownerOf(uint256 tokenId) external virtual view returns (address owner);

    /**
     * @dev  NFT (`tokenId`)  (`from`)
     *  (`to`) .
     *
     * 
     *
     * :
     * - `from`, `to` 0  .
     * - `tokenId` `from`   .
     * -   `from` , `approve` 
     * `setApproveForAll`   NFT   .
     */
    function safeTransferFrom(address from, address to, uint256 tokenId) external virtual;
    /**
     * @dev  NFT (`tokenId`)   (`from`)
     *  (`to`) .
     *
     * :
     * -   `from` , `approve` 
     * `setApproveForAll`   NFT   .
     */
    function transferFrom(address from, address to, uint256 tokenId) external virtual;
    function approve(address to, uint256 tokenId) external virtual;
    function getApproved(uint256 tokenId) external virtual view returns (address operator);

    function setApprovalForAll(address operator, bool _approved) external virtual;
    function isApprovedForAll(address owner, address operator) external virtual view returns (bool);


    function safeTransferFrom(address from, address to, uint256 tokenId, bytes memory data) external virtual;
} 

// https://github.com/OpenZeppelin/openzeppelin-solidity/blob/v2.3.0/contracts/token/ERC721/IERC721Receiver.sol
/**
 * @title ERC721   
 * @dev ERC721   safeTransfers  
 *   .
 */
abstract contract IERC721Receiver {
    /**
     * @notice NFT  
     * @dev ERC721   `safeTransfer`   
     *   .       ,
     *       .  
     * `this.onERC721Received.selector`   .  
     *        .
     * : ERC721     .
     * @param operator `safeTransferFrom`   
     * @param from    
     * @param tokenId   NFT 
     * @param data     
     * @return bytes4 `bytes4(keccak256("onERC721Received(address,address,uint256,bytes)"))`
     */
    function onERC721Received(address operator, address from, uint256 tokenId, bytes memory data)
    external virtual returns (bytes4);
}

// https://github.com/OpenZeppelin/openzeppelin-solidity/blob/v2.3.0/contracts/token/ERC721/ERC721.sol
abstract contract ERC721 is ERC165, IERC721 {
    using SafeMath for uint256;
    using Address for address;
    using Counters for Counters.Counter;

    // `bytes4(keccak256("onERC721Received(address,address,uint256,bytes)"))` 
    // `IERC721Receiver(0).onERC721Received.selector`   
    bytes4 private constant _ERC721_RECEIVED = 0x150b7a02;

    //  ID  
    mapping (uint256 => address) private _tokenOwner;

    //  ID   
    mapping (uint256 => address) private _tokenApprovals;

    //     
    mapping (address => Counters.Counter) private _ownedTokensCount;

    //  (operator)   
    mapping (address => mapping (address => bool)) private _operatorApprovals;

    /*
     *     bytes4(keccak256('balanceOf(address)')) == 0x70a08231
     *     bytes4(keccak256('ownerOf(uint256)')) == 0x6352211e
     *     bytes4(keccak256('approve(address,uint256)')) == 0x095ea7b3
     *     bytes4(keccak256('getApproved(uint256)')) == 0x081812fc
     *     bytes4(keccak256('setApprovalForAll(address,bool)')) == 0xa22cb465
     *     bytes4(keccak256('isApprovedForAll(address,address)')) == 0xe985e9c
     *     bytes4(keccak256('transferFrom(address,address,uint256)')) == 0x23b872dd
     *     bytes4(keccak256('safeTransferFrom(address,address,uint256)')) == 0x42842e0e
     *     bytes4(keccak256('safeTransferFrom(address,address,uint256,bytes)')) == 0xb88d4fde
     *
     *     => 0x70a08231 ^ 0x6352211e ^ 0x095ea7b3 ^ 0x081812fc ^
     *        0xa22cb465 ^ 0xe985e9c ^ 0x23b872dd ^ 0x42842e0e ^ 0xb88d4fde == 0x80ac58cd
     */
    bytes4 private constant _INTERFACE_ID_ERC721 = 0x80ac58cd;

    constructor () {
        // ERC165  ERC721    
        _registerInterface(_INTERFACE_ID_ERC721);
    }

    /**
     * @dev    .
     * @param owner   
     * @return uint256    
     */
    function balanceOf(address owner) external override view returns (uint256) {
        require(owner != address(0), "ERC721: balance query for the zero address");

        return _ownedTokensCount[owner].current();
    }

    /**
     * @dev   ID  .
     * @param tokenId uint256    ID
     * @return address   ID   
     */
    function ownerOf(uint256 tokenId) public override view returns (address) {
        address owner = _tokenOwner[tokenId];
        require(owner != address(0), "ERC721: owner query for nonexistent token");

        return owner;
    }

    /**
     * @dev   ID    .
     * (zero)     .
     *        .
     *       .
     * @param to address   ID   
     * @param tokenId uint256    ID
     */
    function approve(address to, uint256 tokenId) public override {
        address owner = ownerOf(tokenId);
        require(to != owner, "ERC721: approval to current owner");

        require(msg.sender == owner || isApprovedForAll(owner, msg.sender),
            "ERC721: approve caller is not owner nor approved for all"
        );

        _tokenApprovals[tokenId] = to;
        emit Approval(owner, to, tokenId);
    }

    /**
     * @dev  ID   ,     0 .
     *   ID    .
     * @param tokenId uint256     ID
     * @return address   ID    
     */
    function getApproved(uint256 tokenId) public override view returns (address) {
        require(_exists(tokenId), "ERC721: approved query for nonexistent token");

        return _tokenApprovals[tokenId];
    }

    /**
     * @dev      .
     *         .
     * @param to     
     * @param approved     
     */
    function setApprovalForAll(address to, bool approved) public override {
        require(to != msg.sender, "ERC721: approve to caller");

        _operatorApprovals[msg.sender][to] = approved;
        emit ApprovalForAll(msg.sender, to, approved);
    }

    /**
     * @dev       .
     * @param owner     
     * @param operator     
     * @return bool      
     */
    function isApprovedForAll(address owner, address operator) public override view returns (bool) {
        return _operatorApprovals[owner][operator];
    }

    /**
     * @dev   ID    .
     *      .  `safeTransferFrom` .
     * msg.sender ,  ,   .
     * @param from   
     * @param to   ID   
     * @param tokenId   uint256 ID
     */
    function transferFrom(address from, address to, uint256 tokenId) public override{
        //solhint-disable-next-line max-line-length
        require(_isApprovedOrOwner(msg.sender, tokenId), "ERC721: transfer caller is not owner nor approved");

        _transferFrom(from, to, tokenId);
    }

    /**
     * @dev   ID     .
     *    ,  `onERC721Received`  .
     *      
     * `bytes4(keccak256("onERC721Received(address,address,uint256,bytes)"))` ;
     *     .
     * msg.sender ,  ,  
     * @param from   
     * @param to   ID   
     * @param tokenId   uint256 ID
     */
    function safeTransferFrom(address from, address to, uint256 tokenId) public override{
        safeTransferFrom(from, to, tokenId, "");
    }

    /**
     * @dev   ID     .
     *    ,  `onERC721Received`  .
     *      
     * `bytes4(keccak256("onERC721Received(address,address,uint256,bytes)"))` ;
     *     .
     * msg.sender ,  ,  
     * @param from   
     * @param to   ID   
     * @param tokenId   uint256 ID
     * @param _data        
     */
    function safeTransferFrom(address from, address to, uint256 tokenId, bytes memory _data) public override{
        transferFrom(from, to, tokenId);
        require(_checkOnERC721Received(from, to, tokenId, _data), "ERC721: transfer to non ERC721Receiver implementer");
    }

    /**
     * @dev     .
     * @param tokenId uint256     ID
     * @return bool   
     */
    function _exists(uint256 tokenId) internal view returns (bool) {
        address owner = _tokenOwner[tokenId];
        return owner != address(0);
    }

    /**
     * @dev     ID     .
     * @param spender    
     * @param tokenId uint256    ID
     * @return bool msg.sender   ID  ,
     * ,    
     */
    function _isApprovedOrOwner(address spender, uint256 tokenId) internal view returns (bool) {
        require(_exists(tokenId), "ERC721: operator query for nonexistent token");
        address owner = ownerOf(tokenId);
        return (spender == owner || getApproved(tokenId) == spender || isApprovedForAll(owner, spender));
    }

    /**
     * @dev      .
     *   ID   .
     * @param to    
     * @param tokenId uint256   ID
     */
    function _mint(address to, uint256 tokenId) internal {
        require(to != address(0), "ERC721: mint to the zero address");
        require(!_exists(tokenId), "ERC721: token already minted");

        _tokenOwner[tokenId] = to;
        _ownedTokensCount[to].increment();

        emit Transfer(address(0), to, tokenId);
    }

    /**
     * @dev      .
     *    .
     *    , _burn(uint256)  .
     * @param owner   
     * @param tokenId uint256   ID
     */
    function _burn(address owner, uint256 tokenId) internal {
        require(ownerOf(tokenId) == owner, "ERC721: burn of token that is not own");

        _clearApproval(tokenId);

        _ownedTokensCount[owner].decrement();
        _tokenOwner[tokenId] = address(0);

        emit Transfer(owner, address(0), tokenId);
    }

    /**
     * @dev      .
     * Reverts if the token does not exist.
     * @param tokenId uint256   ID
     */
    function _burn(uint256 tokenId) internal {
        _burn(ownerOf(tokenId), tokenId);
    }

    /**
     * @dev   ID       .
     * transferFrom , msg.sender  .
     * @param from   
     * @param to   ID    
     * @param tokenId uint256   ID
     */
    function _transferFrom(address from, address to, uint256 tokenId) internal {
        require(ownerOf(tokenId) == from, "ERC721: transfer of token that is not own");
        require(to != address(0), "ERC721: transfer to the zero address");

        _clearApproval(tokenId);

        _ownedTokensCount[from].decrement();
        _ownedTokensCount[to].increment();

        _tokenOwner[tokenId] = to;

        emit Transfer(from, to, tokenId);
    }

    /**
     * @dev   `onERC721Received`   .
     *        .
     *
     *      .
     * @param from   ID    
     * @param to    
     * @param tokenId uint256   ID
     * @param _data bytes     
     * @return bool   (magic value)  
     */
    function _checkOnERC721Received(address from, address to, uint256 tokenId, bytes memory _data)
        internal returns (bool)
    {
        if (!to.isContract()) {
            return true;
        }

        bytes4 retval = IERC721Receiver(to).onERC721Received(msg.sender, from, tokenId, _data);
        return (retval == _ERC721_RECEIVED);
    }

    /**
     * @dev   ID     .
     * @param tokenId uint256   ID
     */
    function _clearApproval(uint256 tokenId) private {
        if (_tokenApprovals[tokenId] != address(0)) {
            _tokenApprovals[tokenId] = address(0);
        }
    }
}

contract MyERC721Card is ERC721{

    struct Card {
        string  name;  //  
        uint256 level; //  
    }

    Card[] public cards; //    0
    address public owner;

    constructor () public {
        owner = msg.sender; //      MyERC721Card  
    }

    function mintCard(string memory name, address account) public {
        require(owner == msg.sender); //     
        uint256 cardId = cards.length; //   ID
        cards.push(Card(name, 1));
        _mint(account, cardId); //   
    }

}

